import React, { FC } from 'react';
import styled from 'styled-components';
import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
};

const StyledHeader = styled.header`
  color: #313b3f;
  ba
`;

const Header: FC = () => (
  <StyledHeader>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
  </StyledHeader>
);

export default Header;
